def ok(op, s, k):
    count_0, count_1 = 0, 0
    for i in range(k):
        if s[i] == "0":
            count_0 += 1
        else:
            count_1 += 1
    min_replace = min(count_0, count_1)
    for i in range(len(s) - k):
        if s[i] == "0":
            count_0 -= 1
        else:
            count_1 -= 1

        if s[i + k] == "0":
            count_0 += 1
        else:
            count_1 += 1
        min_replace = min(min_replace, min(count_0, count_1))
    return min_replace <= op


