using System;
namespace calc
{
	internal class Program
	{
		//Основная функция
		static void Main(string[] args)
		{
			//Бесконечное повторение блока (Бесконечный цикл), чтобы программа всегда работала
			while (true)
			{
				//Ввод 1 числа
				Console.Write("Введите число А>");
				float a = float.Parse(Console.ReadLine());
				
				//Ввод 2 числа
				Console.Write("Введите число Б>");
				float b = float.Parse(Console.ReadLine());

				//Ввод действия, можно было и Console.ReadLine();  использовать, но можно и так,
				//т.к вводим 1 символ

				Console.Write("Выберите действие: +,-,*,/ >");
				char command = (char)Console.Read();
				//Результат расчётов
				float res = 0;

				//Выбор действия 
				switch (command)
				{
					case '+'://Если ввели +
						{
							res = a + b;
							break;
						}
					case '-'://Если ввели -
						{
							res = a - b;
							break;
						}
					case '*': //Если ввели *
						{
							res = a * b;
							break;
						}
					case '/': //Если ввели  /
						{
							res = a / b;
							break;
						}
				}

				//Вывод результата
				Console.WriteLine($"\nРезультат действия ' {command} ' = {res}\n\n");
				Console.ReadLine();
			}
		}
	}
}

