function barcode(input) {

    let pattern = /(@#{1,})(?<word>[A-Z][A-Za-z(?<digits>\d)]{4,}[A-Z])(@#{1,})/g;
    let digitPattern = /\d/g;

    let numberBarcode = Number(input.shift());

    for (let i = 0; i < numberBarcode; i++) {

        let barcode = input[i];

        let matchCode = pattern.exec(barcode);

        if (matchCode === null) {
            console.log('Invalid barcode');
        }

        while (matchCode) {

            let word = matchCode.groups.word;

            let printDigits = '';

            for (let i = 0; i < word.length; i++) {

                let symbol = word[i];

                let checkIsDigit = digitPattern.test(symbol);

                if (checkIsDigit) {
                    printDigits += word[i];
                }
            }

            if (printDigits === '') {

                console.log('Product group: 00');

            } if (printDigits !== '') {

                console.log(`Product group: ${printDigits}`);

                printDigits = '';
            }

            matchCode = pattern.exec(barcode);
        }
    }
}

