function calculate(){
    const bmi = berat.value / (tinggi.value * tinggi.value)
    result.innerHTML = bmi.toFixed(1)

    if(tinggi.value == "" || berat.value == ""){
        result.innerHTML = "Isi terlebih dahulu tinggi dan berat badan"
        result.style.color = "black"
        category.innerHTML = ""
    } else if(bmi < 18.5){
        category.innerHTML = "Underweight"
        category.style.color = "red"
        result.style.color = "red"
    } else if(bmi >= 18.5 && bmi < 25 ){
        category.innerHTML = "Normal"
