}

/*
  Write a function that takes in a Binary Search Tree (BST) and a positive
  integer k and returns the k-th largest integer contained in the BST
  
  You can assume that there will only be integer values in the BST
  and that 'k' is less than or equal to the number of nodes in the tree.
  
  duplicate integers will be treated as distinct values
*/
export class BST {
  value: number;
  left: BST | null;
  right: BST | null;

  constructor(value: number) {
    this.value = value;
    this.left = null;
    this.right = null;
  }
}
function findKthLargestValue(tree: BST, k: number) {
  const arr: number[] = [];
  iterateThroughTree(tree, arr);

  return arr[k - 1];
}

function iterateThroughTree(node: BST, arr: number[]) {
  if (!node.left && !node.right) {
    arr.push(node.value);
    return;
  }

  if (node.right) {
    iterateThroughTree(node.right, arr);
  }
  arr.push(node.value);

  if (node.left) {
    iterateThroughTree(node.left, arr);
  }
}

